import React from 'react';
import {Box, Grid, ThemeProvider} from "@mui/material";
import theme from "./theme";
import NavBar from "./components/NavBar";
import jzPic from "./asset/jz.png"

function App() {
    return (
        <ThemeProvider theme={theme}>
            <Box sx={{minHeight: "2000px"}}>
                <NavBar/>
                <Box>
                    <Box
                        sx={{
                            // backgroundColor: "red",
                            minHeight: 600,
                            padding: {

                            }
                        }}>
                        <Grid container spacing={2}
                              sx={{
                              }}>
                            <Grid item md={6} xs={12}>
                                <Box sx={{
                                    display: "flex",
                                    justifyContent: "center",
                                }}>
                                    hello
                                </Box>
                            </Grid>
                            <Grid item md={6} xs={12}>
                                <Box sx={{
                                    display: "flex",
                                    justifyContent: "center",
                                }}>
                                    <Box
                                        component="img"
                                        alt="A picture of me(JZ)"
                                        src={jzPic}
                                    />
                                </Box>
                            </Grid>
                        </Grid>
                    </Box>
                </Box>
            </Box>

        </ThemeProvider>
    );
}

export default App;
